/**
 * Created by agros on 09.06.2019.
 */
import gqt from 'graphql-tag';

export default gqt`
    mutation AddContact (
        $name: String!,
        $phone: String!,
        $email: String!
    ){
        addContact(name: $name, phone: $phone, email: $email){
            name
            phone
            email
        }
    }
`;
